import React, { useState, useEffect } from 'react'

function App() {

  const [data, setData] = useState([{}]);
  useEffect(() => {
     getData = async () => {
      const response = await fetch("/members");
      const jsonData = await response.json();
      setData(jsonData.members);
    }
  }, [data.members])

  const array = data.map((item, i) => {
    console.log("In array declare:" + item);
    <li key={i}>{item}</li>
  });

  return (
    <div >
      <span>My new app</span>
      <ul>{array === undefined ? <span>loading</span> : array}</ul>
      {console.log("in div:" + array)}
    </div>
  );
}

export default App;
